import React, { Component } from 'react'
import './About.css';

export default class About extends Component {
  render() {
    return (
      <div class="about-cover">
        <div class="container">
          <div class="row">
            <div class="col-md-12">
              <h1>Qui sommes-nous ?</h1>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
